import './style/MobilePage.scss'; 

const MobilePage = () => {

    const openInNewTab = (url: string) => {
        window.open(url, "_blank", "noreferrer")
    }

  return (
    <div className='mobile-page-container'>
        <div className='header'>
            <span>Woah there Buddy !</span>
        </div>
        <div className='info-text'>
            <span>Seems like your Window is either higher than it is wide or your Window isn't high enough... Are you on Mobile?<br/> Sadly this Page isn't optimized for Mobile, so you'll have to go to a PC.<br/> If you ARE on a PC, what kind of weird Window Size do you have...?</span>
            <br/>
            <br/>
            <span onClick={() => {openInNewTab("https://github.com/Skiftstar")}}>If you want to check out my Github Projects tho, just tap this Text</span>
        </div>
        <div className='info-text'>
            <span>Dein Fenster scheint höher als breit zu sein oder dein Fenster ist nicht hoch genug... Bist du am Handy?<br/> Leider ist diese Website nicht für Handys ausgelegt, also musst du an deinen PC.<br/> Wenn du am PC schon bist... Was für 'ne komische Fenstergröße hast du?</span>
            <br/>
            <br/>
            <span onClick={() => {openInNewTab("https://github.com/Skiftstar")}}>Wenn du einfach nur meine Projekte auf Github sehen willst, tipp einfach auf den Text hier</span>
        </div>
    </div>
  );
}

export default MobilePage;
